import React from 'react';

const EmployeeItem = props => {
  const { name, location, email, login, id, picture } = props.employee;
  return (
    <div>
      <div key={id.value}>
        <img src={picture.thumbnail} />
        {name.first} {name.last} {email}
      </div>
    </div>
  );
};

export default EmployeeItem;
